import React, { Component } from 'react';

class EmployeForm extends Component {
    render() {
        return (
            <div className="employeeForm">
                <form>
                    <div className="form-row">
                        <label>Name</label>
                        <input type="text"/>
                    </div>
                    <div className="form-row">
                        <label>Email</label>
                        <input type="email"/>
                    </div>
                    <div className="form-row">
                        <label>Phone no.</label>
                        <input type="text"/>
                    </div>
                    <div className="form-row">
                        <label>Your photo</label>
                        <input type="file"/>
                    </div>
                </form>
            </div>
        );
    }
}

export default EmployeForm;
